import React from "react";
import "./tasks-filter.css";

const TasksFilter = ({acctiv}) => {
    const butEL = [
        {text: 'All', id: 'Al'},
        {text: 'Active', id: 'Ac'},
        {text: 'Completed', id: 'Com'}
    ];

    return (
        <li key={butEl.id }>
            <button onClick={acctiv} className={butEl.className}>{butEl.text}</button>
            <button onClick={acctiv} className={butEl.className}>{butEl.text}</button>
            <button onClick={acctiv} className={butEl.className}>{butEl.text}</button>
        </li>
    );
}

export default TasksFilter;
